import axios from 'axios';
import React, { Component } from 'react';
import Navbar from './compenents/Navbar';
import Product_detail from './compenents/wishlist_component';

class Wishlist extends Component {
    constructor(props){
        super(props)
        this.refresh = this.refresh.bind(this)
    }
    state = {
        posts:[],
        success:''
    }
    componentDidMount(){
        axios.get('/sadfasfwr234/')
        .then(response =>{
            console.log(response.data,"Response")
           this.setState({
               posts:response.data
           })
        })
    }
    refresh(){
        axios.get('/sadfasfwr234/')
        .then(response =>{
            console.log(response.data,"Response")
           this.setState({
               posts:response.data
           })
        })
    }
    render() { 
        return (
            <div>
                <Navbar />
                <br/>

                <div className='container'>
                <h1>Wishlist</h1>
                <br/>
              
                <table class="table table-hover">
                    <tbody>
                    <tr>
                        <td>Product Name</td>
                        <td>Action</td>
                        <td>Delete</td>
                    </tr>
                    {this.state.posts.map(product => <Product_detail key = {product.id} product = {product} state = {this.state} mount = {this.refresh} />)}
                    </tbody>
                </table>
              
                </div>
            </div>
        );
    }
}
 
export default Wishlist;
